(41385, 120, 'elements_8_blocks_0_body', '<h6>Risk Ranking</h6>\r\n<h2>Probabilistic Risks</h2>\r\nGet information about the probable impacts from all earthquakes that could occur in your area over time, to help you better plan and manage these hazards.\r\n\r\nFor your area you can learn about:\r\n<ul>\r\n 	<li>The potential impacts from earthquakes over a 50 year period</li>\r\n 	<li>How your earthquake risk compares to other areas</li>\r\n</ul>'),
